import React, { useState, useEffect } from 'react';
import './App.css';

const specialtiesList = [
  "General Physician", "Dentist", "Dermatologist", "Paediatrician", "Gynaecologist", "ENT",
  "Diabetologist", "Cardiologist", "Physiotherapist", "Endocrinologist", "Orthopaedic",
  "Ophthalmologist", "Gastroenterologist", "Pulmonologist", "Psychiatrist", "Urologist",
  "Dietitian/Nutritionist", "Psychologist", "Sexologist", "Nephrologist", "Neurologist",
  "Oncologist", "Ayurveda", "Homeopath"
];

const App = () => {
  const [doctors, setDoctors] = useState([]);
  const [filteredDoctors, setFilteredDoctors] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [suggestions, setSuggestions] = useState([]);
  const [consultationType, setConsultationType] = useState('');
  const [selectedSpecialties, setSelectedSpecialties] = useState([]);
  const [sortOption, setSortOption] = useState('');

  useEffect(() => {
    const mockData = [
      { name: "Dr. Munaf Inamdar", specialties: ["General Physician"], experience: 33, fee: 800, consultationTypes: ["Video Consult", "In Clinic"] },
      { name: "Dr. Subhash Bajaj", specialties: ["General Physician", "Cardiologist"], experience: 27, fee: 500, consultationTypes: ["Video Consult"] },
      { name: "Dr. Mufaddal Zakir", specialties: ["General Physician"], experience: 14, fee: 700, consultationTypes: ["In Clinic"] },
      { name: "Dr. Ajay Gangoli", specialties: ["Dermatologist"], experience: 4, fee: 500, consultationTypes: ["Video Consult", "In Clinic"] },
      { name: "Dr. Devanshi Chaudhary", specialties: ["Dentist"], experience: 15, fee: 400, consultationTypes: ["In Clinic"] },
      { name: "Dr. Devanshi Vaghani", specialties: ["Dentist"], experience: 4, fee: 250, consultationTypes: ["In Clinic"] }
    ];
    setDoctors(mockData);
    setFilteredDoctors(mockData);

    const params = new URLSearchParams(window.location.search);
    setSearchTerm(params.get('search') || '');
    setConsultationType(params.get('consultation') || '');
    setSelectedSpecialties(params.get('specialties')?.split(',') || []);
    setSortOption(params.get('sort') || '');
  }, []);

  useEffect(() => {
    const params = new URLSearchParams();
    if (searchTerm) params.set('search', searchTerm);
    if (consultationType) params.set('consultation', consultationType);
    if (selectedSpecialties.length > 0) params.set('specialties', selectedSpecialties.join(','));
    if (sortOption) params.set('sort', sortOption);
    window.history.pushState({}, '', `${window.location.pathname}?${params.toString()}`);
    applyFilters();
  }, [searchTerm, consultationType, selectedSpecialties, sortOption]);

  const applyFilters = () => {
    let filtered = [...doctors];

    if (searchTerm) {
      filtered = filtered.filter(doctor =>
        doctor.name.toLowerCase().includes(searchTerm.toLowerCase())
      );
    }

    if (consultationType) {
      filtered = filtered.filter(doctor =>
        doctor.consultationTypes.includes(consultationType)
      );
    }

    if (selectedSpecialties.length > 0) {
      filtered = filtered.filter(doctor =>
        doctor.specialties.some(specialty => selectedSpecialties.includes(specialty))
      );
    }

    if (sortOption === 'fees') {
      filtered.sort((a, b) => a.fee - b.fee);
    } else if (sortOption === 'experience') {
      filtered.sort((a, b) => b.experience - a.experience);
    }

    setFilteredDoctors(filtered);
  };

  const handleSearchChange = (e) => {
    const value = e.target.value;
    setSearchTerm(value);

    if (value) {
      const matches = doctors
        .filter(doctor => doctor.name.toLowerCase().includes(value.toLowerCase()))
        .slice(0, 3);
      setSuggestions(matches);
    } else {
      setSuggestions([]);
    }
  };

  const handleSuggestionClick = (name) => {
    setSearchTerm(name);
    setSuggestions([]);
  };

  const handleConsultationChange = (type) => {
    setConsultationType(type);
  };

  const handleSpecialtyChange = (specialty) => {
    setSelectedSpecialties(prev =>
      prev.includes(specialty)
        ? prev.filter(s => s !== specialty)
        : [...prev, specialty]
    );
  };

  const handleSortChange = (option) => {
    setSortOption(option);
  };

  return (
    <div className="container">
      {/* Search */}
      <div className="search-container">
        <input
          data-testid="autocomplete-input"
          type="text"
          value={searchTerm}
          onChange={handleSearchChange}
          placeholder="Search doctors..."
          className="search-input"
        />
        {suggestions.length > 0 && (
          <ul className="suggestions-list">
            {suggestions.map((doctor, index) => (
              <li
                key={index}
                data-testid="suggestion-item"
                onClick={() => handleSuggestionClick(doctor.name)}
                className="suggestion-item"
              >
                {doctor.name}
              </li>
            ))}
          </ul>
        )}
      </div>

      <div className="main-content">
        {/* Sort + Filters */}
        <div className="filter-panel">
          <div className="filter-section">
            <h3 data-testid="filter-header-sort" className="filter-header">Sort by</h3>
            <label className="filter-option">
              <input
                type="radio"
                name="sort"
                value="fees"
                checked={sortOption === 'fees'}
                onChange={() => handleSortChange('fees')}
                data-testid="sort-fees"
              />
              Fees: Low-High
            </label>
            <label className="filter-option">
              <input
                type="radio"
                name="sort"
                value="experience"
                checked={sortOption === 'experience'}
                onChange={() => handleSortChange('experience')}
                data-testid="sort-experience"
              />
              Experience: High-Low
            </label>
          </div>

          {/* Merged Filters Section */}
          <div className="filter-section filter-group-box">
            <h3 className="filter-header">Filters</h3>

            <div className="sub-filter-section">
              <strong>Mode of Consultation</strong>
              <label className="filter-option">
                <input
                  type="radio"
                  name="consultation"
                  value="Video Consult"
                  checked={consultationType === 'Video Consult'}
                  onChange={() => handleConsultationChange('Video Consult')}
                  data-testid="filter-video-consult"
                />
                Video Consultation
              </label>
              <label className="filter-option">
                <input
                  type="radio"
                  name="consultation"
                  value="In Clinic"
                  checked={consultationType === 'In Clinic'}
                  onChange={() => handleConsultationChange('In Clinic')}
                  data-testid="filter-in-clinic"
                />
                In Clinic
              </label>
            </div>

            <div className="sub-filter-section">
              <strong>Specialties</strong>
              <div className="specialties-list">
                {specialtiesList.map(specialty => (
                  <label key={specialty} className="filter-option">
                    <input
                      type="checkbox"
                      checked={selectedSpecialties.includes(specialty)}
                      onChange={() => handleSpecialtyChange(specialty)}
                      data-testid={`filter-specialty-${specialty.replace(/\//g, '-')}`}
                    />
                    {specialty}
                  </label>
                ))}
              </div>
            </div>
          </div>
        </div>

        {/* Doctors List */}
        <div className="doctor-list">
          {filteredDoctors.map((doctor, index) => (
            <div
              key={index}
              data-testid="doctor-card"
              className="doctor-card"
            >
              <div className="doctor-info">
                <h3 data-testid="doctor-name">{doctor.name}</h3>
                <p data-testid="doctor-specialty">{doctor.specialties.join(', ')}</p>
                <p data-testid="doctor-experience">{doctor.experience} yrs exp.</p>
              </div>
              <div>
                <p data-testid="doctor-fee" className="doctor-fee">â‚¹{doctor.fee}</p>
                <button className="book-button">Book Appointment</button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default App;
